    <div class="py-5 text-center">
      <img class="d-block mx-auto mb-4" src="/assets/images1.png" alt="" width="72" height="65">
      <h2>Sign Up to calculate</h2>
      <p class="lead">Sign up here to calculate the GPA/CGPA for the students of Anna University. CGPA-Calculator also helps to save the semester marks in the user's dashboard.</p>
    </div>

    <div class="row g-5">
      <div class="col-md-7 col-lg-8">
        <h4 class="mb-3">Register</h4>

