                <input type="password" class="form-control" id="firstName" placeholder="password" [(ngModel)]="register.password">
              </div>

              <div class="col-sm-6">
                <label for="firstName" class="form-label">Registration Number</label>
                <input type="text" class="form-control" id="firstName" placeholder="Registration Number" [(ngModel)]="register.registernumber" required>
              </div>

            <div class="col-12">
              <label for="address2" class="form-label">Contact</label>
              <input type="text" class="form-control" id="address2" placeholder="contact" [(ngModel)]="register.contact">
            </div>


        </div>

          <hr class="my-4">

          <button class="w-100 btn btn-primary btn-lg" type="submit" (click)="postRegisterService()">Sign Up</button>
      </div>
    </div>
  </main>

  <footer class="my-5 pt-5 text-muted text-center text-small">
    <p class="mb-1">&copy; 2022 Nikhil M R</p>
